pragma solidity ^0.4.21;

import "./Ownable.sol";
import "./EternalStorage.sol";

contract EternalStorageAPI is Ownable {

    EternalStorage private _eternalStorage;

    event EternalStorageSet(address oldEternalStorage, address newEternalStorage);

    constructor (address eternalStorage) internal {
        require(eternalStorage != 0);
        emit EternalStorageSet(_eternalStorage, eternalStorage);
        _eternalStorage = EternalStorage(eternalStorage);
    }

    function whichEternalStorage() public view returns(address) {
        return _eternalStorage;
    }

    function setEternalStorage(address newEternalStorage) onlyOwner external returns(bool) {
        require(newEternalStorage != 0);
        emit EternalStorageSet(_eternalStorage, newEternalStorage);
        _eternalStorage = EternalStorage(newEternalStorage);
        return true;
    }

}
